import styled from 'styled-components';

const Form = styled.form`
  padding: 1em;
  width: 500px;
  border: solid 1px black;
  label {
    display: block;
  }

  input {
    box-sizing: border-box;
    width: 100%;
  }

  .form {
    margin-bottom: 1.2em;
  }
`;

export default Form;
